(18, 39, 'F049 Falcovací iletková fréza - H9,5 D34,9x12 L55 S=8 HMvv', 'F049 Falcovací iletková fréza - H9,5 D34,9x12 L55 S=8 HM', '<p>Falcovací fréza je vybavena kopírovacím vodícím loiskem B = 15,8 mm pro šíøku falcu H = 9,5 mm.<br /><br />K této fréze je moné dokoupit kopírovací loiska prùmìrù B = 9,5–12,7–19–22–28,5–34,9 mm, kterımi vyrobíte šíøku falcu H = 12,7–11,1–8–6,3–3,2–0 mm.<br />K volitelnému loisku potøebujete podloku C54155200, aby vám loisko nesjídìlo.</p>', '_vyr_39f049.jpg', 0, '1159.20', '1288.00', 'F049-35581', '_vyrn_39f049.jpg', '_vyrp11_39f049-1.jpg', '_vyrp12_39f049-2.jpg', '_vyrp13_39f049-3.jpg', 21, 1, 0, 0, '', 0, '2-1-17-335|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2020-09-25 13:07:22'),
(19, 40, 'F049 Velká falcovací fréza - H16 D50,8x28,3 L87,3 S=12 HM', 'F049 Velká falcovací fréza - H16 D50,8x28,3 L87,3 S=12 HM', '<p>• Šikmé ostøí pro lepší odvod tøísek. <br />• Pro oøezávání i nejobtínìjších dílù podle šablony. <br />• HM tvrdokovové bøity. <br />• Speciální kopírovací loisko na èele frézy. <br />• Prodlouená délka ostøí. <br /><br />Velká falcovací fréza je dodávána se základní sadou loisek a kroukem 19mm pro frézování 15,8 mm falcu. K této fréze je moné dokoupit 3 sady kopírovacích kroukù, se kterımi vyrobíte 17 rùznıch rozmìrù falcù. Pøi frézování falcù vìtších ne 12 mm provádìjte vícenásobné úbìry pomocí postupného zvìtšování hloubky. <br /><br />Doporuèujeme pouití ve frézovacím stolku.</p>', '_vyr_40f049-4.jpg', 0, '1623.60', '1804.00', 'F049-50821', '_vyrn_40f049-4.jpg', '_vyrp11_40f049-5.jpg', '_vyrp12_40f049-6.jpg', '_vyrp13_40f049-7.jpg', 21, 1, 0, 0, '', 0, '2-1-17-336|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2020-09-25 13:07:22'),
