(69, 107, 'IGM FKP656 Vrtací pøípravek sada 656mm + ZDARMA 100ks kolíkù 8x35', 'IGM FKP656 Vrtací pøípravek sada 656mm + ZDARMA 100ks kolíkù 8x35', '<p><strong>• Pro kolíkování na hranì dílce<br />• Pro spojování na konfirmáty<br />• Monost upnutí rùznıch prùmìrù vrtákù<br />• Rozteè otvorù v evropské normì</strong><br /> </p>\\n<p><strong>Univerzální vrtací pøípravek je urèen pro pøesné a produktivní ruèní kolíkování nábytkovıch dílcù. Docílíte vysokou pøesnost a produktivitu práce. Jednotlivé pozice dìr jsou konstruovány s rozteèí 32mm, co odpovídá standardní euro normì pro strojní kolíkování dílcù. Pøípravek je urèen pro pouití našich kolíkovacích vrtákù z HM tvrdokovovou špièkou, které jsou upnuté ve vrtacím pouzdru stejnım systémem jako v kolíkovaèce.</strong><br /> </p>\\n<p><strong>Pøesnost a jednoduchost pøi vrtání kolíkù</strong><br />Vrtací pøípravek automaticky vytváøí pøesnı rohovı spoj s fazetkou 0,5mm. Koncové dorazy<br />pøípravku zajišují zarovnání spojovanıch dílcù z pøední nebo zadní strany.<br /> </p>\\n<p>Kolíky i konfirmáty je moné vyrábìt pouhou vımìnou vrtákù ve vrtacím pouzdøe.<br /><br /><strong>Vrtání ko', '_vyr_107pictureprovider-aspx.jpg', 0, '3800.00', '4089.00', 'FKP656-set', '_vyrn_107pictureprovider-aspx.jpg', '_vyrp11_107pictureprovider1-aspx.jpg', '_vyrp12_107pictureprovider2-aspx.jpg', '', 21, 1, 1, 1, '', 0, '4-107-384-0|4-0-0-0|4-107-0-0', NULL, '2020-09-25 13:07:23'),
