(159, 216, 'KOTOUÈOVÁ STOLNÍ PILA HOLZMANN TS 250 - 400V', 'KOTOUÈOVÁ STOLNÍ PILA HOLZMANN TS 250 - 400V', '<h1 id=\\\"h1-fig\\\">Kotouèová stolní pila HOLZMANN TS 250 400 V</h1>\\n<p><strong>Kotouèová stolní pila HOLZMANN TS 250</strong> má oproti modelu kotouèové pily HOLZMANN TS 200 s a 250 mm nástrojem vıraznì <strong>masivnìjší konstrukci a monost motoru i na napìtí 400 V</strong>. Tento pøístroj se perfektnì hodí do jakékoli dílny. <strong>Litinovı stùl</strong> tohoto stroje je velmi robustní a stabilní. Nesmí chybìt také ani <strong>prodlouení stolu</strong>. Pila má tu vıhodu, e je velice <strong>jednoduše nastavitelná</strong> a lehce se s ní manipuluje.<strong> Pilovı agregát je naklopitelnı a na 45 stupòù</strong>. Souèástí je samozøejmì <strong>podélné pravítku s doladìním</strong> a <strong>pøíèné pravítko s dorazem</strong> pro pøesnìjší práci.</p>\\n<p>Zde mùete zhlédnout podrobnı a snadno pochopitelnı <strong>návod</strong> k sestavení této pily ve vaší dílnì. Pro více informací mùete navštívit naše stránky <a href=\\\"https://aparatea.cz/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"', '_vyr_1935238_1742__vyr_1418TS250.jpg', 0, '21569.00', '0.00', '2HLMTS250400', '_vyrn_1935238_1742__vyr_1418TS250.jpg', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-62-0-0', NULL, '2020-09-25 13:07:23'),
