(162, 219, 'Swanson - protiskluzové pravítko s pøesnım mìøítkem', 'Swanson - protiskluzové pravítko s pøesnım mìøítkem', '<p>Swanson -Savage je jednoduché profilové pravítko s pøesnou stupnicí pro rısování,mìøení a hlavnì øezání noem. Protiskluzová podloka zabrání posunu po materiálu a tvar profilu zabrání sklouznutí noe a pøípadnému poøezání.</p>', '_vyr_19618411_swanson-savage-straight-edge-sve360-product-shot.jpg', 0, '640.00', '0.00', 'SVE121', '_vyrn_19618411_swanson-savage-straight-edge-sve360-product-shot.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2020-09-25 13:07:23'),
(163, 220, 'Swanson - sloupková magnetická vodováha', 'Swanson - sloupková magnetická vodováha', '<ul>\\r\\n<li>\\r\\n<p> Magnetické pásky nebo stahovací guma pro upevnìní na sloupek</p>\\r\\n</li>\\r\\n<li>\\r\\n<p>Zhotovenı z  houevnatého kompozitního materiálu</p>\\r\\n</li>\\r\\n<li>\\r\\n<p>Tou nejlepší volbou pro kovové kolíky</p>\\r\\n</li>\\r\\n<li><span style=\\\"font-size: 10pt;\\\">Sloupky , zábradlí ,kolíky nebo tyèky k rajèatùm vše bude snadno rovné nebo kolmé</span></li>\\r\\n</ul>', '_vyr_1978519_swnason-sloupkova-magneticka-vodovaha.jpg', 0, '155.00', '0.00', 'PL001M', '_vyrn_1978519_swnason-sloupkova-magneticka-vodovaha.jpg', '', '', '', 21, 1, 0, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2020-09-25 13:07:23'),
