(450, 551, 'CMT Sada na ornamenty, fréza 3D S=8mm, šablona KLASIK s rámem', 'CMT Sada na ornamenty, fréza 3D S=8mm, šablona KLASIK s rámem', '<p>Vıhodná sada obsahuje frézu na ornamenty a šablonu na zásuvky s rámem s klasickım vzorem A. Za zvıhodnìnou cenu získáte nejpouívanìjší vzor a frézu na ornamenty. Kdykoliv si mùete dokoupit další vzory a rámy z naší nabídky.<br /><br />Ornamenty upadly dlouhá léta v zapomnìní. Nyní jsou však opìt v kurzu a jejich renesanci napomáhá i snadnìjší vıroba pomocí unikátní šablony CRCS znaèky CMT. S tímto pøípravkem mùete vyrobit krásné rozety, rohové ornamenty na dveøe nebo rámy, ornamenty na kuchyòská dvíøka, ornamenty na èela postelí nebo skøíní. Nábytek z masivu ozdobenı ornamenty zaívá nyní renesanci a proto se podívejme jak to všechno funguje.<br /><br /><strong>Jak frézování ornamentù funguje?</strong><br />1. Pøipevnìte rám na díl.<br />2. Umístìte šablonu a pøi frézování kopírujte vıøezy.<br />3. Pøemístìte šablonu a opakujte postup.<br />4. Hotovı ornament</p>', '_vyr_551CRCS-START1.jpeg', 0, '3020.00', '3357.00', 'CRCS-START1', '_vyrn_551CRCS-START1.jpeg', '_vyrp11_551CRCS-START1-1.jpeg', '_vyrp12_551CRCS-START1-2.jpeg', '', 21, 1, 0, 0, '', 0, '4-0-0-0|4-107-0-0|4-107-385-0', NULL, '2020-09-25 13:07:25'),
