(487, 589, 'C2S Úhlová fréza na Corian – D32×25 L57 S12 15° HW', ' C2S Úhlová fréza na Corian – D32×25 L57 S12 15° HW', '<p>Tato fréza je urèena pro spojení horní pracovní desky a umyvadla nebo døezu Corianu pod úhlem 15°.</p>\\n<p>Fréza je vybavena loiskem s ochranou proti špinìní materiálu. Urèená pro ruèní horní frézky. Frézuje také velmi dobøe jakékoliv materiály ze døeva nebo døevìnıch materiálù. Ideální pro vırobu kuchyòskıch døezù nebo koupelnovıch umyvadel.</p>', '_vyr_589C2S-K-web.jpg', 0, '1237.50', '1375.00', 'GZ3273', '_vyrn_589C2S-K-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-351-0|14-0-0-0|14-618-0-0', NULL, '2020-09-25 13:07:25'),
