(621, 741, 'CMT Pilovı kotouè na cementotøískové desky - D160x2,2 d20 Z4 Diamantovı', 'CMT Pilovı kotouè na cementotøískové desky - D160x2,2 d20 Z4 Diamantovı', '<p>Pilovı kotouè s kónickım nebo rovnım diamantovım zubem pro dìlení extra tvrdıch materiálù jako jsou: DuPont Corian®, cementotøískové a cementovláknité desky (Cetris, Eternit®, Swisspearl®, Fermacell®, Ivarplank®, Hardieplank®), MDF, DTD, termoplasty a sádrokarton, vhodné pro pokosové, zkracovací, ruèní elektrické nebo akumulátorové pily. Vysoká ivotnost diamantovıch zubù.</p>', '_vyr_741C23616004H.jpeg', 0, '1058.00', '1176.00', 'C23616004H', '_vyrn_741C23616004H.jpeg', '_vyrp11_741C23616004H-1.jpeg', '_vyrp12_741C23616004H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-23-0', NULL, '2020-09-25 13:07:26'),
