(627, 748, 'CMT Pilovı kotouè pro velkoplošné pily - D300x4,4 d30 Z60 16° HM', 'CMT Pilovı kotouè pro velkoplošné pily - D300x4,4 d30 Z60 16° HM', '<p>Pro formátování jednotlivıch desek nebo desek ve stohu na horizontálních velkoplošnıch pilách. Pro materiál oboustrannì laminované døevotøísky nebo MDF desky.<br /><br /><strong>Pøíklady unašecích dìr: </strong><br />p / d1 / t mm<br />p = poèet unašecích otvorù<br />d1 = prùmìr unašecích otvorù<br />t = rozteè unašecích otvorù<br /><br />Pilové kotoouèe mají provedení unašecích otvorù sdruené do skupin COMBI3, COMBI5 a COMBI7.<br /><br /><strong>COMBI3</strong><br />2/7/42 mm<br />2/9/46,4 mm<br />2/10/60 mm<br /><br /><strong>COMBI5</strong><br />2/7/110 mm<br />2/8,4/130 mm<br />2/14/110 mm<br />4/9/100 mm<br />4/19/120 mm<br /><br /><strong>COMBI7</strong><br />2/10/80 mm<br />1/11/85 mm<br />2/11/115 mm<br />2/11/148 mm<br />2/14/100 mm<br />2/14/125 mm<br />2/19/120 mm</p>', '_vyr_748C28206012M.jpeg', 0, '2031.00', '2257.00', 'C28206012M', '_vyrn_748C28206012M.jpeg', '_vyrp11_748C28206012M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-7-0-0|2-7-47-0', NULL, '2020-09-25 13:07:26'),
