(1549, 2020, 'Rybinovı nástavec Virutex', 'Rybinovı nástavec Virutex', '<p><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Pøesnı nástroj pro vytváøení rybinového spoje. Standardnì se dodává se šablonou se sklonem 26 mm, kterou lze nahradit <br />další šablonou s jinım sklonem. Stroj je vybaven zarákami pro frézované díly, které poskytují vysoce kvalitní napojení spoje.<br />Polotovary jsou umístìny ve dvojicích v horizontální a vertikální rovinì s pøesahem odpovídajícím stoupání. Mùe bıt pouit s <br /></span><span lang=\\\"cs\\\">frézkami FR66P, FR160P, FRE160P, FR277R, FR278R nebo AS93. Podešev frézy je zcela poloena na ploše, èím je udrena <br />stabilita. Poškzení spoje je tedy nepravdìpodobné.<br /><br /></span></span></p>\\n<p style=\\\"font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</p>\\n<ul>\\n<li><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Pracovní šíøka: 360 mm</span></span></li>\\n<li><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Rozestupy šablony: 26 mm</span></spa', 'https://b2b-itatools.pl/Obrazki/PL11_PL11.jpg', 0, '9043.00', '10047.00', 'PL11', '', '_vyrp11_2020pl11_1.jpg', '_vyrp12_2020pl11_2.jpg', '_vyrp13_2020pl11_3.jpg', 21, 1, 1, 0, '', 0, '4-497-502-0', NULL, '2020-09-25 13:07:31'),
(1550, 2021, 'Šablona pro vrtání dìr pro spojovací kolíky (d=8mm) pro desky (16 a 19mm) Virutex', 'Šablona pro vrtání dìr pro spojovací kolíky (d=8mm) pro desky (16 a 19mm) Virutex', '<p>Šablona je pouívána pro pøesné vrtání otvorù pro spojovací prostøedky. <span>Urèeno pro vrtání otvorù, slepıch nebo prùchozích, pro spojovací prvky pro spojování panelù o tloušce 16 a 19 mm pomocí kruhového kolíku (&#216; 8 mm) nebo nábytkovıch šroubù (confermat). Vzhledem k vysoké pøesnosti tohoto produktu není nutná ádná další konfigurace. Mùete tedy vytvoøit spojení jakéhokoli typu podél okraje nebo konce a dokonce uprostøed dílce. <span lang=\\\"cs\\\">Nepostradatelnı nástroj pro provádìní malıch objednávek, oprav, úprav atd. Standardní vıbava zahrnuje rozpìrky pro panely 16 mm, pouzdro adaptéru &#216; 8/5 mm a zastavení vrtání. Pøi pouití šablony je nutné dodrovat zásadu jednoty bází, tzn. pokud pøi zpracování boèních stìn zakládáte šablonu na pøední stranì, pak pøi zpracování protilehlé èásti by mìla bıt šablona zaloena na pøední stranì. Celková délka 600mm.</span></span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proè vırobek', 'https://b2b-itatools.pl/Obrazki/PM11D_PM11D.jpg', 0, '1426.00', '1585.00', 'PM11D', '', 'https://b2b-itatools.pl/Obrazki/PM11D_pm11dd1.jpg', 'https://b2b-itatools.pl/Obrazki/PM11D_pm11dd2.jpg', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2020-09-25 13:07:31'),
