(1571, 2054, 'Pilovı kotouè kónickı P36 - rozkliknutím vyberete konkrétní produkt', 'Pilovı kotouè kónickı pro náøezová centra P36', '<p><strong>Pouití:</strong></p>\\n<p>Pilovı kotouè typu P36 je ideální pro formátování velkoplošnıch materiálù jako je LDT, DTD, MDF A HDF. Jeho velkou vıhodou je moné pouití jak pro podélné, tak i pro pøíèné øezy. Dosahuje dlouhé ivotnosti díky materiálu, ze kterého je vyroben. Jedná se o tvrdokov - karbit wolframu.</p>\\n<p><strong>Stroje:</strong></p>\\n<p>Pilovı kotouè lze snadno pouít v nejrùznìjších strojích, jako jsou formátovací pily èi CNC náøezová centra.</p>\\n<p><strong>Materiál:</strong></p>\\n<p>Tento kvalitní pilovı kotouè P36 lze vyuít pøedevším pro formátování jednostrannì èi oboustrannì laminovanıch desek, DTD, MDF, HPL. Díky materiálu, ze kterého je vyroben, vám bude dobrım a spolehlivım pomocníkem.</p>', '_vyr_2054P36-180045036-000_1-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', 0, '0.00', '0.00', 'P36', '', '', '', '', 21, 1, 2, 0, '', 0, '2-2-0-0', NULL, '2020-09-25 13:07:31'),
(1572, 2058, 'Pøedøezovı kotouè kónickı P36 - po rozkliknutí vyberte konkrétní produkt', 'Pøedøezovı kotouè kónickı', '<h4><strong>POUITÍ:</strong></h4>\\n<p>Pøedøezovı kónickı kotouè je vhodnı pøedevším pro práce, jako jsou formátovací øezy. Díky tvaru zubù na pøedøezovıch kotouèích lze dosáhnout perfektního finálního øezu. Vıhodou je jeho pouití jak pro pøíèné tak pro podélné øezy.</p>\\n<h4>STROJE:</h4>\\n<p>Pøedøezové kotouèe P36 lze dobøe vyuít ve strojích, jako jsou stolní pily, horizontální a vertikální formátovací stroje vybavené pøedøezovım agregátem s vıškovım nastavením.</p>\\n<h4>MATERIÁL:</h4>\\n<div>Kotouè je vyroben z kvalitního tvrdokovu - karbidu wolframu.</div>\\n<div>Kotouèe je tedy ideální pouít pøedevším pro jednostrannì nebo oboustrannì laminované desky, DTD, HPL.</div>\\n<p></p>\\n<p></p>', '_vyr_2058P36-100020020-000_1-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', 0, '0.00', '0.00', 'P36', '', '', '', '', 21, 1, 2, 0, '', 0, '2-2-21-0', NULL, '2020-09-25 13:07:31'),
