(1692, 7735, 'Pilovı kotouè D250mm / Z80 / F30mm', 'Pilovı kotouè D250mm / Z80 / F30mm', '<p><strong>Pouití:</strong></p>\\n<p>Tento pilovı kotouè je velmi vhodnı pro formátovací øezy materiálu, jako je lamino èi døevotøíska. Dokáe vytvoøit perfektní finální øez díky jeho tvarovanım zubùm.</p>\\n<p><strong>Stroje:</strong></p>\\n<p>Pilovı kotouè je vhodnı zejména pro stolní pily, horizontální a vertikální formátovací stroje.</p>\\n<p><strong>Materiál:</strong></p>\\n<p>Kotouè mùete pouít ideálnì pro práci s jednostrannì èi oboustrannì laminovanımi deskami, DTD, HPL.</p>', '_vyr_7735_vyr_2057P15-250030080-00W_P15-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', 0, '1786.00', '0.00', 'P15.250030080.000', '_vyrn_7735_vyr_2057P15-250030080-00W_P15-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', '_vyrp11_7735_vyrp11_2057P15-250030080-00W_P15-250030080-00W_2-20-20-20-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', '_vyrp12_7735_vyrp11_2057P15-250030080-00W_P15-250030080-00W_2-20-20-20-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-2-0-0|2-2-20-0|2-7-0-0|2-7-47-0', NULL, '2020-09-25 13:10:36'),
