(1765, 7819, 'Pøedøezovı skládanı kotouè DSC.070020016.004', 'DIA pøedøezovı skládanı kotouè', '<h3><strong>Pouití:</strong></h3>\\n<p>Ideální pro formátování odolnıch materiálù. Velkou vıhodou je moné pouití pro pøíèné nebo podélné formátování. Pøedøezovı kotouè má a 50× delší vıdr ne HW kotouèe díky speciálnímu polykrystalickému diamantovému zubu.</p>\\n<p>Tím pádem tento kotouè disponuje naprosto bezkonkurenènì<span> </span><strong>nejlepším pomìrem<span> </span><em>kvalita/cena/vıkon!</em></strong> </p>\\n<h3><strong>Stroje:</strong></h3>\\n<p>Velice vhodné je pouití tohoto kotouèe na strojích jako jsou stolní pily, horizontální a vertikální formátovací stroje èi CNC pily vybavené pøedøezovım agregátem s moností nastavení vıšky øezu.</p>\\n<h3><strong>Materiál:</strong></h3>\\n<p>Pøedøezovı kotouè lze velmi dobøe vyuít pøi formátování jednostrannì nebo oboustrannì laminovanıch desek, DTD, MDF, HPL.</p>\\n<div></div>\\n<h3><strong>PODROBNÁ SPECIFIKACE VŠECH PØEDØEZOVİCH KOTOUÈÙ:</strong></h3>\\n<table border=\\\"3\\\" cellpadding=\\\"1\\\" width=\\\"100%\\\" height=\\\"285\\\">\\n<tbody>\\n<tr>', '_vyr_7819DSC-070020016-006_DSC_ITATOOLSOUT.jpg', 0, '8022.00', '0.00', 'DSC.070020016.004', '_vyrn_7819DSC-070020016-006_DSC_ITATOOLSOUT.jpg', '', '', '', 21, 1, 0, 0, '', 0, '10-0-0-0|2-0-0-0|2-2-0-0|2-2-20-0|2-2-20-356|2-7-0-0|2-7-47-0|2-7-47-563|10-475-0-0|10-475-561-0', NULL, '2020-09-25 13:10:36'),
